import React from "react";
import "./homepage.styles.scss";
import Directory from "../../components/directory/directory.component";
import { HomepageContainer } from "./homepage.styles";

const HomePage = () => (
  <HomepageContainer>
    <Directory></Directory>
  </HomepageContainer>
);

export default HomePage;
